interface AutocompleteInputProps {
    label: string;
    name: keyof FilterProps;
    value: string;
    placeholder?: string;
    suggestions: string[];
    onValueChange: (name: keyof FilterProps, value: string) => void;
    disabled?: boolean;
}

const AutocompleteInput: React.FC<AutocompleteInputProps> = ({ label, name, value, placeholder, suggestions, onValueChange, disabled }) => {
    const [showSuggestions, setShowSuggestions] = useState(false);
    const wrapperRef = useRef<HTMLDivElement>(null);

    const filteredSuggestions = suggestions.filter(s => s.toLowerCase().includes(value.toLowerCase()));

    const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        onValueChange(name, e.target.value);
        setShowSuggestions(true);
    };

    const handleSuggestionClick = (suggestion: string) => {
        onValueChange(name, suggestion);
        setShowSuggestions(false);
    };

    useEffect(() => {
        function handleClickOutside(event: MouseEvent) {
            if (wrapperRef.current && !wrapperRef.current.contains(event.target as Node)) {
                setShowSuggestions(false);
            }
        }
        document.addEventListener("mousedown", handleClickOutside);
        return () => document.removeEventListener("mousedown", handleClickOutside);
    }, [wrapperRef]);
    
    return (
        <div className="relative w-full" ref={wrapperRef}>
            <label htmlFor={name} className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">{label}</label>
            <input
                type="text"
                id={name}
                name={name}
                value={value}
                onChange={handleInputChange}
                onFocus={() => setShowSuggestions(true)}
                placeholder={placeholder}
                disabled={disabled}
                className="block w-full pl-3 pr-10 py-3 text-base border border-gray-300 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm rounded-md dark:bg-slate-700 dark:border-slate-600 dark:text-white disabled:opacity-50 disabled:cursor-not-allowed"
                autoComplete="off"
            />
            {showSuggestions && value && filteredSuggestions.length > 0 && (
                <ul className="absolute z-10 w-full bg-white dark:bg-slate-800 border border-gray-300 dark:border-slate-600 rounded-md mt-1 max-h-60 overflow-auto shadow-lg">
                    {filteredSuggestions.map((suggestion, index) => (
                        <li
                            key={index}
                            onClick={() => handleSuggestionClick(suggestion)}
                            className="px-4 py-2 cursor-pointer hover:bg-gray-100 dark:hover:bg-slate-700 text-gray-900 dark:text-gray-200"
                        >
                            {suggestion}
                        </li>
                    ))}
                </ul>
            )}
        </div>
    );
};

// --- Pozostałe komponenty i typy (bez zmian) ---

interface CustomButtonProps { title: string; type?: 'button' | 'submit' | 'reset'; containerStyle?: string; handleClick?: () => void; }
const CustomButton: React.FC<CustomButtonProps> = ({ title, type = 'button', containerStyle, handleClick }) => (
  <button type={type} className={`flex flex-row relative justify-center items-center py-3 px-6 outline-none ${containerStyle}`} onClick={handleClick}>
    <span className={`flex-1`}>{title}</span>
  </button>
);

interface Option { value: string; title: string; }
interface CustomSelectProps { label: string; name: string; options: Option[]; value: string; onChange: (name: string, value: string) => void; containerStyle?: string; }
const CustomSelect: React.FC<CustomSelectProps> = ({ label, name, options, value, onChange, containerStyle }) => (
  <div className={`w-full ${containerStyle}`}>
    <label htmlFor={name} className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">{label}</label>
    <select id={name} name={name} value={value} onChange={(e) => onChange(name, e.target.value)} className="block w-full pl-3 pr-10 py-3 text-base border border-gray-300 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm rounded-md dark:bg-slate-700 dark:border-slate-600 dark:text-white">
      <option value="">{`Wybierz ${label}`}</option>
      {options.map((option) => (<option key={option.value} value={option.value}>{option.title}</option>))}
    </select>
  </div>
);

interface CustomInputProps { label: string; name: string; value?: string | number; onChange: (e: React.ChangeEvent<HTMLInputElement>) => void; placeholder?: string; type?: string; containerStyles?: string; }
const CustomInput: React.FC<CustomInputProps> = ({ label, name, value, onChange, placeholder, type = 'text', containerStyles }) => (
    <div className={`w-full ${containerStyles}`}>
        <label htmlFor={name} className="block text-sm font-medium text-gray-700 dark:text-gray-300 mb-1">{label}</label>
        <input type={type} id={name} name={name} value={value} onChange={onChange} placeholder={placeholder} className="block w-full pl-3 pr-10 py-3 text-base border border-gray-300 focus:outline-none focus:ring-indigo-500 focus:border-indigo-500 sm:text-sm rounded-md dark:bg-slate-700 dark:border-slate-600 dark:text-white" />
    </div>
);

const CloseIcon = () => (<svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className="dark:invert"><line x1="18" y1="6" x2="6" y2="18"></line><line x1="6" y1="6" x2="18" y2="18"></line></svg>);

interface Serie { "Serie Name": string; }
interface CarDataItem { brand: string; models: Record<string, Serie[]>; }



interface AdvancedFilterProps {
  isOpen: boolean;
  onClose: () => void;
  filters: FilterProps;
  setFilters: Dispatch<SetStateAction<FilterProps>>;
  handleApply: () => void;
}

// --- GŁÓWNY KOMPONENT PRZEPISANY OD NOWA ---

const AdvancedFilter = ({ isOpen, onClose, filters, setFilters, handleApply }: AdvancedFilterProps) => {
  
  const typedCarData = carData as unknown as CarDataItem[];
  
  // --- Logika sugestii ---
  const brandSuggestions = typedCarData.map(item => item.brand);

  const modelSuggestions = filters.brand
    ? Object.keys(typedCarData.find(item => item.brand === filters.brand)?.models || {})
    : [];
    
  const versionSuggestions = (filters.brand && filters.model)
    ? typedCarData.find(item => item.brand === filters.brand)
        ?.models[filters.model]
        ?.map(serie => serie["Serie Name"]) || []
    : [];

  // --- Handlery ---
  const handleAutocompleteChange = (name: keyof FilterProps, value: string) => {
    setFilters(prev => {
        const newState = { ...prev, [name]: value };
        if (name === 'brand') {
            newState.model = '';
            newState.version = '';
        }
        if (name === 'model') {
            newState.version = '';
        }
        return newState;
    });
  };

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value } = e.target;
    const numericValue = e.target.type === 'number' ? (value === '' ? undefined : Number(value)) : value;
    setFilters(prev => ({ ...prev, [name]: numericValue }));
  };

  const handleSelectChange = (name: string, value: string) => {
    setFilters(prev => ({ ...prev, [name]: value }));
  };

  const handleClearFilters = () => {
  setFilters({
    brand: '',
    model: '',
    version: '',
    // --- POPRAWKA ---
    cylinders: [], // Dodano brakującą właściwość
    // --- KONIEC POPRAWKI ---
    fuelType: '',
    mileageTo: undefined,
    engineCapacityTo: undefined,
    priceFrom: undefined,
    priceTo: undefined,
    yearFrom: undefined,
    yearTo: undefined,
  });
};

  return (
    <>
      <div className={`fixed inset-0 bg-black bg-opacity-50 z-40 transition-opacity duration-300 ${isOpen ? 'opacity-100' : 'opacity-0 pointer-events-none'}`} onClick={onClose} />
      <div className={`fixed top-0 right-0 h-full w-full max-w-sm bg-white dark:bg-slate-900 shadow-lg z-50 transform transition-transform duration-300 ease-in-out ${isOpen ? 'translate-x-0' : 'translate-x-full'}`}>
        <div className="flex flex-col h-full">
          <div className="flex items-center justify-between p-4 border-b border-gray-200 dark:border-slate-700">
            <h2 className="text-lg font-semibold text-gray-800 dark:text-gray-200">Filtry Zaawansowane</h2>
            <button onClick={onClose} className="text-gray-500 hover:text-gray-800 dark:hover:text-gray-300"><CloseIcon /></button>
          </div>

          <div className="flex-grow p-6 overflow-y-auto space-y-6">
            <AutocompleteInput label="Marka" name="brand" value={filters.brand} onValueChange={handleAutocompleteChange} suggestions={brandSuggestions} placeholder="np. BMW, Audi"/>
            <AutocompleteInput label="Model" name="model" value={filters.model} onValueChange={handleAutocompleteChange} suggestions={modelSuggestions} placeholder="np. A4, Seria 3" disabled={!filters.brand}/>
            <AutocompleteInput label="Wersja" name="version" value={filters.version || ''} onValueChange={handleAutocompleteChange} suggestions={versionSuggestions} placeholder="np. G05, B9" disabled={!filters.model} />
            <hr className="dark:border-slate-700"/>
            <CustomInput label="Przebieg do (km)" name="mileageTo" type="number" placeholder="np. 150000" value={String(filters.mileageTo || '')} onChange={handleInputChange} />
            <CustomSelect label="Rodzaj paliwa" name="fuelType" options={fuels} onChange={handleSelectChange} value={filters.fuelType} containerStyle="z-30"/>
            <CustomInput label="Pojemność do (cm³)" name="engineCapacityTo" type="number" placeholder="np. 1998" value={String(filters.engineCapacityTo || '')} onChange={handleInputChange} />
            <div className="flex gap-4">
              <CustomInput label="Cena od (PLN)" name="priceFrom" type="number" placeholder="0" value={String(filters.priceFrom || '')} onChange={handleInputChange} />
              <CustomInput label="Cena do (PLN)" name="priceTo" type="number" placeholder="100000" value={String(filters.priceTo || '')} onChange={handleInputChange} />
            </div>
            <div className="flex gap-4">
                <CustomSelect label="Rok od" name="yearFrom" options={yearsOfProduction} onChange={handleSelectChange} value={String(filters.yearFrom || '')} containerStyle="z-20"/>
                <CustomSelect label="Rok do" name="yearTo" options={yearsOfProduction} onChange={handleSelectChange} value={String(filters.yearTo || '')} containerStyle="z-10"/>
            </div>
          </div>

          <div className="p-4 border-t border-gray-200 dark:border-slate-700">
            <div className="flex gap-4">
              <CustomButton title="Wyczyść filtry" containerStyle="w-full bg-gray-200 dark:bg-slate-700 text-gray-800 dark:text-gray-200" handleClick={handleClearFilters} />
              <CustomButton title="Zastosuj" containerStyle="w-full bg-blue-600 text-white" handleClick={handleApply} />
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default AdvancedFilter;

